  "mongodb+srv://darwin:gand27ef@cluster0.i1rve.mongodb.net/myFirstDatabase?retryWrites=true&w=majority";
const startServer = async () => {
  const app = express();

  const server = new ApolloServer({
    typeDefs,
    resolvers,
